public OpenBitSet getRandomSet(int sz, int bitsToSet) {
  OpenBitSet bs = new OpenBitSet(sz);
  if (sz==0) return bs;
  for (int i=0; i<bitsToSet; i++) {
    bs.fastSet(rand.nextInt(sz));
  }
  return bs;
}

